const auth0_domain = 'internal.staging.entur.org';
const auth0_aduience = 'api.staging.entur.io';

const client = new ApolloClient({
    uri: 'https://api.entur.io/journey-planner/v2/graphql',
    fetchOptions: {
        mode: 'no-cors',
    },
});


client.query({
    query: gql`
    {
        lines(authorities:"GOA:Authority:GOA") {
            id
            name
            quays {
                id
                name
            }
         }
    }
`,
})
    .then(data => console.log(data))
    .catch(error => console.error(error));

export default{ authorization };



